import React, { useState } from 'react';

function MealFilterForm() {
    const [calorieMin, setCalorieMin] = useState('');
    const [calorieMax, setCalorieMax] = useState('');
    const [mealTypes, setMealTypes] = useState('');
    const [cuisineTypes, setCuisineTypes] = useState('');
    const [diets, setDiets] = useState('');
    const [healthPreferences, setHealthPreferences] = useState('');

    const handleSubmit = (e) => {
        e.preventDefault();
        // You can implement filtering logic here
        console.log("Filters submitted:", { calorieMin, calorieMax, mealTypes, cuisineTypes, diets, healthPreferences });
    };

    return (
        <form onSubmit={handleSubmit}>
            <div style={{ maxWidth: '900px' }}>
                <h5>Diet Options</h5>
                <div style={{ maxHeight: '200px', overflowY: 'auto' }}>
                    <div>
                        <label>
                            Min Cal:
                            <input type="text" value={calorieMin} onChange={e => setCalorieMin(e.target.value)} />
                        </label>
                        <label>
                            Max Cal:
                            <input type="text" value={calorieMax} onChange={e => setCalorieMax(e.target.value)} />
                        </label>
                        <label>
                            Meal Types (comma-separated):
                            <input type="text" value={mealTypes} onChange={e => setMealTypes(e.target.value)} />
                        </label>
                        <label>
                            Cuisine Types (comma-separated):
                            <input type="text" value={cuisineTypes} onChange={e => setCuisineTypes(e.target.value)} />
                        </label>
                    </div>
                    <div>
                        <label>
                            Diets (comma-separated):
                            <input type="text" value={diets} onChange={e => setDiets(e.target.value)} />
                        </label>
                        <label>
                            Health Preferences (comma-separated):
                            <input type="text" value={healthPreferences} onChange={e => setHealthPreferences(e.target.value)} />
                        </label>
                        <button type="submit">Apply Filters</button>
                    </div>
                </div>
            </div>
        </form>
    );
}

export default MealFilterForm;
